function birthdayCakeCandles(ar){
    let candlesMap = new Map();
    let maxKey = 0; 
    ar.map((value) => {
        if(candlesMap[value]) {
            candlesMap[value]++;
        }
        else  {
            candlesMap[value]=1;
        }   
    })

    for(key in candlesMap) {
        let intKey = parseInt(key);
        maxKey = maxKey < intKey ? intKey : maxKey;
    }

    console.log(candlesMap);
    console.log(candlesMap[maxKey]);
}

